"use strict";(self.webpackChunkstatic_site=self.webpackChunkstatic_site||[]).push([[582],{582:a=>{a.exports=JSON.parse('[{"id":"0066902c-dfbc-4094-82d7-817c1e4533e0","slug":"san-mateo-county-pride-center","externalUrl":"https://sanmateopride.org/","tags":["transmasculine","non-binary","transfeminine","healthcare","mental-health","social-services"],"address":"1021 S El Camino Real, San Mateo, CA 94402, USA","phoneNumber":"650-591-0133","country":"US","provinceOrState":"CA","city":"San Mateo","county":"San Mateo County","latLng":[37.5569591,-122.3189073],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/san-mateo-county-pride-center-san-mateo","googleMapsUrl":"https://goo.gl/maps/uj5ogP9y4LboxZYD9","facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Kituo cha Pride cha Kaunti ya San Mateo","description":"Kituo cha Pride cha Kaunti ya San Mateo ni mfano wa shirika la ushirikiano na duka moja la LGBTQ+ community. Tunatoa mipango na huduma thabiti kusaidia wanachama wa jumuiya ya LGBTQ+ wa umri wote, ikiwa ni pamoja na elimu, mafunzo, matukio ya jamii, vikundi vya msaada wa rika, programu ya kila siku, tiba ya kliniki, na usimamizi wa kesi."},{"id":"07e16941-b605-4cf5-bab5-bdc882c51a1d","slug":"queerspace","externalUrl":"https://www.queerspace.org.au/","tags":["mental-health","social-services","youth-services","support-groups","parent-family-resources","education-awareness"],"address":"100 Drummond St, Carlton VIC 3053, Australia","phoneNumber":"03 9663 6733","country":"AU","provinceOrState":"VIC","city":"Carlton","county":"City of Melbourne","latLng":[-37.8043894,144.9681606],"email":"enquiries@ds.org.au","socialMedia":{"yelpUrl":null,"googleMapsUrl":null},"title":"Queerspace","description":"Queerspace ni huduma ya msaada wa afya na ustawi wa LGBTIQ+ ilianzishwa mnamo 2009 na jamii za LGBTIQ+ kwa jamii za LGBTIQ+. Ina mkazo kwa mahusiano, familia, malezi na vijana na inatoa huduma zilizopo pamoja katika eneo la kaskazini- magharibi la mji wa Victoria. Huduma ni pamoja na ushauri, usimamizi wa kesi, utetezi, huduma za msaada, msaada wa rika, maendeleo ya kitaalam, mafunzo na ushauri."},{"id":"0db36ba9-b329-4a54-8302-d7810866457a","slug":"diyhrtcafe","externalUrl":"https://diyhrt.cafe","tags":["transfeminine","non-binary","transmasculine","healthcare","education-awareness"],"title":"DIYHRT.cafe","description":"Jamii inayochanua mtandaoni na kitovu cha maarifa kwa watu binafsi wanaovutiwa na tiba ya kubadilisha homoni (HRT) kwa kujitegemea. Tovuti yao imejitolea kutoa nafasi salama na jumuishi ambapo watu wanaweza kupata habari, rasilimali, na msaada kwa HRT inayosimamiwa na mtu binafsi. Iwe unachunguza njia mbadala, unatafuta mwongozo kuhusu kipimo na utawala, au unatafuta tu kuungana na wengine ambao wana shiriki uzoefu kama huo, DIYHRT.cafe inatoa mtazamo wa thamani nyingi, hadithi za kibinafsi, na ushauri wa wataalam kusaidia kufanya maamuzi yaliyoarifiwa kuhusu afya yako na ustawi."},{"id":"11cfde25-5434-4fae-b782-c9597ebe52f3","slug":"deifydeify-qtibipoc-collective","externalUrl":"https://linktr.ee/deifycbr","tags":["social-services","support-groups","community-stories","education-awareness"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"QTIBIPOC Canberra Facebook Group"},"title":"DEiFYDEiFYQTIBIPOC Kikundi kinachoishi katika Ngunnawal, Ngunawal na Ngambri Country","description":"Hii ni mkutano wa pamoja wa jamii ya DEiFYQTIBIPOC. Kikundi pia kitajadili Queer Masculinities Zine na orodha yao maalum ya kucheza."},{"id":"1873eb7a-2dcb-4346-bf6b-91a97237072f","slug":"nsw-service-for-the-treatment-and-rehabilitation-of-torture-and-trauma-survivors","externalUrl":"https://www.startts.org.au/","tags":["healthcare","mental-health","social-services"],"phoneNumber":"+61 (0)2 9646 6700","country":"AU","provinceOrState":"NSW","city":"Carramar","address":"152/168 The Horsley Dr, Carramar NSW 2163, Australia","latLng":[-33.8801011,150.9654668],"email":"stts-startts@health.nsw.gov.au","socialMedia":{"twitterUrl":"https://twitter.com/starttsNSW","facebookUrl":"https://www.facebook.com/STARTTSNSW","instagramUrl":"https://www.instagram.com/startts_nsw/","linkedinUrl":"https://www.linkedin.com/company/startts/","youtubeUrl":"https://www.youtube.com/user/starttsvideos"},"county":"City of Fairfield","title":"Huduma ya NSW kwa Matibabu na Urekebishaji wa Waathiriwa wa Utesaji na Mshtuko","description":"STARTTS ni shirika la kitaalamu, lisilo la faida linalotoa matibabu ya kisaikolojia yanayofaa kwa utamaduni, msaada, na hatua za jamii kusaidia watu na jamii kupona kutokana na mateso na mshtuko wa wakimbizi na kujenga upya maisha yao nchini Australia. Pia wanasaidia watu binafsi wa LGBTQIA+ kutoka kwa wakimbizi na asili za watafuta hifadhi."},{"id":"18ba5d3d-c47d-47f8-90a4-2f353a1f13ce","slug":"ftmguideorg","externalUrl":"https://FTMGuide.org","tags":["non-binary","transmasculine","healthcare","clothing"],"title":"FTMGuide.org","description":"Jukwaa la mtandaoni lenye habari za kina linalojitolea kuwasaidia watu wanaopitia mchakato wa kubadilika kutoka jinsia ya kike kwenda kiume (FTM). Tovuti yao inatumika kama rasilimali inayoaminika, ikitoa wingi wa habari, mwongozo, na mawasiliano ya jamii kwa wale wanaoanza safari yao ya FTM. Kutoka kwenye ushauri wa vitendo kuhusu tiba ya homoni na chaguzi za upasuaji hadi msaada wa afya ya akili na hadithi za kibinafsi, FTMGuide.org inalenga kuwapa watu uwezo kwa maarifa na rasilimali wanazohitaji kuendesha mabadiliko yao kwa ujasiri na uelewa."},{"id":"1e8cb769-f49b-4428-86ea-2c4cbec96905","slug":"transfemscienceorg","externalUrl":"https://transfemscience.org","tags":["transfeminine","non-binary","healthcare"],"title":"transfemscience.org","description":"Jukwaa la mtandaoni linalovunja rekodi linalojitolea kutoa utafiti unaotegemea ushahidi, elimu, na rasilimali kwa jamii ya wabadilikaji na wasio na jinsia, na mkazo maalum kwenye tiba ya homoni ya kufeminisha (FHT). Tovuti yao inahudumu kama kitovu muhimu kwa watu wanaotafuta habari za kuaminika na za hivi karibuni juu ya upande wa matibabu, kisaikolojia, na kifizikia wa FHT. Kupitia mkusanyiko wao kamili wa tafiti zilizopitiwa na wenzao, makala za wataalam, na mwongozo wa vitendo, tovuti yao inawawezesha watu kufanya maamuzi yenye taarifa kuhusu mabadiliko na afya yao."},{"id":"3143b616-c478-4c99-9cbd-ed16c89a1c70","slug":"meridian-support","externalUrl":"https://www.meridianact.org.au/","tags":["healthcare","support-groups","education-awareness","community-stories"],"address":"Havelock House, 85 Northbourne Ave, Turner ACT 2612, Australia","phoneNumber":"(02) 6257 2855","country":"AU","provinceOrState":"ACT","city":"Turner","latLng":[-35.2736943,149.1291121],"email":"contact@meridianact.org.au","socialMedia":null,"title":"Meridian","description":"Meridian imekuwa ikishikilia na kusaidia jamii ya LGBTIQA+ kwa zaidi ya miaka 40, ikitoa huduma na mipango mbalimbali katika eneo la Canberra kama vile huduma za HIV, huduma za ustawi, mipango ya ufikiaji wa wafanya kazi wa jinsia na zaidi."},{"id":"3b112584-39e6-4ef6-9e75-a465acdea54c","slug":"northern-territory-aids-and-hepatitis-council-inc","externalUrl":"https://www.ntahc.org.au/","tags":["healthcare","social-services","education-awareness"],"address":"46 Woods St, Darwin City NT 0800, Australia","phoneNumber":"08 8944 7777","country":"AU","provinceOrState":"NT","city":"Darwin City","county":"City of Darwin","latLng":[-12.4602736,130.8432107],"email":"info@ntahc.org.au","socialMedia":{"yelpUrl":null,"googleMapsUrl":"https://www.google.com/maps?q=46+Woods+StreetDARWIN+NT+0800"},"title":"Bunge la UKIMWI na Hepatitis wa Wilaya ya Kaskazini Inc.","description":"Jibu la jamii kwa Virusi vinavyoambukizwa na Damu kwenye Wilaya ya Kaskazini, likilenga kuondoa maambukizi yao. Inatoa huduma anuwai kama vile kuunga mkono LGBTI Living, kukuza utawala wa wafanyakazi wa ngono, na kutoa uhamasishaji wa afya na maduka ya afya."},{"id":"3b5a33bd-aba4-4205-9a86-293b172e38ee","slug":"genderdysphoriafyi","externalUrl":"https://genderdysphoria.fyi","tags":["transmasculine","non-binary","transfeminine","mental-health","support-groups","community-stories","education-awareness"],"title":"genderdysphoria.fyi","description":"Rasilimali ya mkondoni inayoaminika kwa watu wanaotafuta maarifa, msaada, na uelewa kuhusu kutokujaliana na jinsia. Tovuti yao inatoa habari nyingi, rasilimali, na uhusiano wa jamii kuwawezesha watu katika safari yao. Kutoka kwenye viongozi kamili kuhusu utambulisho wa jinsia na kubadilisha hadi hadithi binafsi na ushauri wa wataalam, wanaojitahidi kuunda nafasi salama na jumuishi kwa wote."},{"id":"3f865b77-21e6-472e-be98-b2cfd999dafb","slug":"unitarian-universalist-association","externalUrl":"https://www.uua.org/","tags":["non-binary","support-groups","education-awareness","spiritual"],"address":"24 Farnsworth St, Boston, MA 02210, USA","phoneNumber":"(617) 742-2100","country":"US","provinceOrState":"MA","city":"Boston","county":"Suffolk County","latLng":[42.35163259999999,-71.04857050000001],"email":"info@uua.org","socialMedia":null,"title":"Chama cha Unitarian Universalist","description":"Jumuiya ya kiroho iliyo wazi ya akili na moyo inayosaidia watu kuongoza maisha ya haki, upendo, kujifunza, na matumaini. Jumuiya inakumbatia utofauti ikiwa ni pamoja na jumuiya ya watu wanaojibadilisha jinsia na inahimiza ushiriki hai katika vitendo vya haki. Pia wanatoa rasilimali, msaada na utetezi kwa masuala mbalimbali ya kijamii."},{"id":"4332f79d-1323-45ca-9b40-df63af9b7179","slug":"movement-advancement-project","externalUrl":"https://www.lgbtmap.org/","tags":["legal","healthcare","education-awareness"],"address":"1905 15th St #1097, Boulder, CO 80302, USA","email":null,"phoneNumber":"(303) 578-4600","country":"US","provinceOrState":"CO","city":"Boulder","county":"Boulder County","latLng":[40.0178641,-105.2763041],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/lgbtmap/","twitterUrl":"https://twitter.com/lgbtmap","instagramUrl":"https://www.instagram.com/lgbtmap/","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Mradi wa Kusonga Mbele","description":"Mradi wa Kusonga Mbele (MAP) ni tanki la kufikiria linalojitegemea, lisilo na faida ambalo hutoa utafiti mkali, ufahamu, na mawasiliano ambayo husaidia kuharakisha usawa na fursa kwa wote. MAP inafanya kazi kuhakikisha kuwa watu wote wanapata nafasi ya haki ya kufuata afya na furaha, kupata kipato, kujali wale wanaowapenda, kuwa salama katika jamii zao, na kushiriki katika maisha ya kiraia."},{"id":"43609b17-7528-4c60-94b4-e90866144715","slug":"jordan-ross-communication-services","externalUrl":"https://www.jordanrosscommunication.com/","tags":["voice-training"],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":"https://www.instagram.com/jordanrosscommunication/","youtubeUrl":"https://www.youtube.com/channel/UC4o7h219hPYdBcPaFpgh9Yw","tiktokUrl":"https://www.tiktok.com/@jordanrosscommunication","twitchUrl":null,"patreonUrl":null},"title":"Huduma za Mawasiliano ya Jordan Ross","description":"Jordan Ross hutoa mafunzo ya hotuba, sauti na mawasiliano kwa watu trans, queer na wenye jinsia isiyo ya kawaida. Anatoa mafunzo ya 1-On-1, kozi za mkondoni, matukio, na \'Mpango wa Mafunzo ya Sauti ya Ndani\'. Njia yake inajumuisha programu ya neva-linguistic, hypnotherapy, maelekezo ya yoga, na mafunzo ya pumzi, lengo likiwa kushughulikia sio tu viungo vya kimwili bali pia viungo vya kiakili, kihisia, na vya nishati vya mawasiliano."},{"id":"4465cbb7-3513-41ae-8878-7a86ebbe9f6a","slug":"gender-dynamix-online-education-portal","externalUrl":"https://www.genderdynamix.org.za/","tags":["transfeminine","transmasculine","non-binary","legal","healthcare","education-awareness","support-groups","community-stories"],"address":"7, 10 Anson St, Observatory, Cape Town, 7925, South Africa","phoneNumber":"+27 (0)21 447 4797","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-33.9368811,18.470378],"email":"info@genderdynamix.org.za","socialMedia":null,"town":"Observatory","title":"Portal ya Elimu Mtandaoni ya Gender Dynamix","description":"Gender Dynamix ni shirika lisilo la faida linalotegemea Afrika ambalo linakusudia kukuza, kuendeleza, na kulinda haki za binadamu za jamii za trans na kijinsia katika Afrika Kusini na Afrika Kusini mwa Jangwa la Sahara. Shirika hilo linasimamia utetezi, linafacilitate uwezo wa kujenga, na linatoa huduma moja kwa moja kwa jamii. Pia wanao rasilimali mtandaoni zinazohusiana na huduma ya afya, mipango ya elimu, na utambuzi wa jinsia halisi."},{"id":"47b17f76-670a-4835-8773-409d98934b91","slug":"sylvia-rivera-law-project","externalUrl":"https://srlp.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"address":"147 W 24th St #5th, New York, NY 10011, USA","phoneNumber":"212-337-8550","country":"US","provinceOrState":"NY","city":"New York","town":"Manhattan","county":"New York County","latLng":[40.744576,-73.9941166],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/sylvia-rivera-law-project-new-york?osq=sylvia+rivera+law+project","googleMapsUrl":"https://goo.gl/maps/sjGv8qoSZPe3XE2QA","facebookUrl":"https://www.facebook.com/sylviariveralawproject","twitterUrl":"https://www.twitter.com/srlp","instagramUrl":"https://instagram.com/sylviariveralawproject/","youtubeUrl":"https://www.youtube.com/user/SylviaRiveraLP","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Mradi wa Sheria wa Sylvia Rivera (SRLP)","description":"Mradi wa Sheria wa Sylvia Rivera unafanya kazi kuhakikisha kuwa watu wote wana uhuru wa kuamua utambulisho na uonyeshaji wa jinsia, bila kujali kipato au rangi, na bila kukabiliwa na unyanyasaji, ubaguzi au vurugu. SRLP inatoa msaada wa kisheria, inaandaa kampeni, inafanya mafunzo, na inaendesha Kamati ya Ushauri ya Wafungwa. Ushiriki wa jamii unahimizwa kupitia michango, kujitolea, na uanachama."},{"id":"499aa5dd-d3c0-42f6-a686-853672f3c71e","slug":"erin-in-the-morning","externalUrl":"https://www.erininthemorning.com/","tags":["transfeminine","legal","healthcare","education-awareness"],"email":"null","socialMedia":{"facebook":"facebook.com/erininthemorning","email":"mailto:info@erininthemorning.com"},"title":"Erin Asubuhi","description":"Habari na majadiliano kuhusu sheria za transgender na maisha. Kwa Erin Reed · Zaidi ya wanachama 38,000"},{"id":"4a930816-9948-45d7-9513-393087685a01","slug":"trans-health-sa","externalUrl":"https://www.transhealthsa.com/","tags":["healthcare","legal","social-services","support-groups","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"SA","city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"https://www.facebook.com/TransHealthSA","googleMapsUrl":null,"yelpUrl":null},"title":"Trans Health SA","description":"Trans Health SA ni kundi la wajitolea linalopo kutoa taarifa na msaada kwa mahitaji ya afya ya watu wa jinsia mbalimbali na wanaobadilishwa jinsia huko South Australia. Inatoa orodha za wataalm wa kiheshima, taarifa za kiafya na kisheria, taarifa kuhusu mashirika yanayounga mkono, mashirika, machapisho, vikundi vya kijamii na vya msaada, na rasilimali zilizoandaliwa na jamii ya watu wanaobadilisha jinsia."},{"id":"4be75e80-8ce1-4f46-90f0-ad307cd1829b","slug":"equaldexcom","externalUrl":"https://EqualDex.com","tags":["transfeminine","non-binary","transmasculine","partner-resources"],"title":"EqualDex.com","description":"Jukwaa la mkondoni lenye ubunifu linalolenga kuunda rasilimali kamili na ya kisasa kwa haki za LGBTQ+ ulimwenguni. Tovuti yao inatoa hifadhidata kuu ya sheria, sera, na mtazamo wa jamii kuelekea haki za LGBTQ+ kutoka ulimwenguni kote. Kwa kukusanya na kuonesha data kuhusu usawa, ujumuishaji, na ulinzi wa kisheria, EqualDex.com inatoa zana yenye nguvu kwa wazalendo, watafiti, na watu binafsi wanaotaka kuelewa na kuhamasisha haki za LGBTQ+ kwenye kiwango cha kimataifa. Gundua ramani zao za kuona na kubadilika, angalia maelezo maalum ya nchi, na ujue maboresho na changamoto za hivi karibuni zinazokabili jamii ya LGBTQ+ ulimwenguni."},{"id":"581b9bb9-0e33-4887-8bf0-0dda3781202c","slug":"a-gender-agenda","externalUrl":"https://genderrights.org.au/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","community-stories","education-awareness","financial-aid-scholarships"],"address":null,"phoneNumber":"(02) 6162 1924","country":"AU","provinceOrState":null,"city":"Canberra","county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Ajenda ya Jinsia","description":"Ajenda ya Jinsia inafanya kazi na kwa niaba ya watu wa jinsia tofauti, trans na intersex, marafiki zao, familia, na washirika. Kupitia elimu, utetezi, msaada wa rika, na mitandao ya kitaaluma, AGA inaunganisha watu na kujenga kutokana na uzoefu wa pamoja. Wao hutoa matukio mengi na rasilimali kwa jamii, ikiwa ni pamoja na makundi ya msaada, mafunzo, rasilimali za elimu. Wao hutoa utetezi na helpline ya mgogoro."},{"id":"58738396-e4d7-424a-ba8d-59559e883f06","slug":"strandsfortransorg","externalUrl":"https://strandsfortrans.org","tags":["transfeminine","non-binary","transmasculine","friendly-businesses","makeup"],"title":"strandsfortrans.org","description":"Strands Kwa Trans ni mtandao wa kimataifa wa nywele, urembo, na viwanda vya ustawi na mashirika yanayotafuta kuunda na kuhamasisha uzoefu salama na chanya kwa wageni wote, haswa wageni kutoka kwa jamii ya trans."},{"id":"594ba858-974c-4c09-8fd4-f4bb35ca6c5f","slug":"pacific-center-for-human-growth","externalUrl":"https://www.pacificcenter.org/","tags":["mental-health","support-groups","healthcare","youth-services","education-awareness"],"address":"2712 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"510-548-8283","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8611143,-122.2593404],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/pacific-center-berkeley","googleMapsUrl":"https://goo.gl/maps/dSnoipA7TWiDN72b7","facebookUrl":"https://www.facebook.com/pacific.center","twitterUrl":null,"instagramUrl":"https://www.instagram.com/pacificcenterberkeley/","youtubeUrl":"https://www.youtube.com/user/TheInQueery","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Kituo cha Kupanua Binadamu cha Pacific","description":"Ilianzishwa mwaka 1973, Kituo cha Kupanua Binadamu cha Pacific ni kituo kikongwe zaidi cha LGBTQIA+ katika eneo la Bay, cha tatu kongwe nchini, na kinatoa kliniki pekee ya afya ya akili inayotumia kipimo cha sliding kwa watu wa LGBTQIA+ na QTBIPOC na familia zao katika Kaunti ya Alameda."},{"id":"5ac3fd1a-2d29-4001-b51c-d3b62d81e090","slug":"transgender-victoria","externalUrl":"https://tgv.org.au/","tags":["transmasculine","transfeminine","non-binary","legal","healthcare","mental-health","social-services","support-groups","parent-family-resources","partner-resources","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"VIC","city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"https://www.facebook.com/TransGenderVictoria/","twitterUrl":"https://twitter.com/transgendervic","instagramUrl":"https://www.instagram.com/transgendervic/"},"title":"Transgender Victoria","description":"TGV ni mwili unaoongoza wa watu wa jinsia tofauti na trans huko Victoria. Tunafanya kazi kufikia haki, usawa na kujumuishwa kwa jamii zetu, washirika wao, familia, marafiki, na washirika. Tunatoa rasilimali mbalimbali, mafunzo, utetezi, na huduma za msaada zilizolenga matokeo ya kijamii, kiuchumi, afya, ustawi, na afya ya akili kwa jamii ya watu wanaobadilisha jinsia."},{"id":"682fba48-f668-4fe6-89a7-05a90193e778","slug":"oakland-lgbtq-community-center","externalUrl":"https://www.oaklandlgbtqcenter.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","education-awareness","financial-aid-scholarships","community-stories","partner-resources"],"address":"3207 Lakeshore Ave, Oakland, CA 94610, USA","phoneNumber":"510-882-2286","country":"US","provinceOrState":"CA","city":"Oakland","county":"Alameda County","latLng":[37.8103802,-122.2459822],"socialMedia":{"yelpUrl":null,"googleMapsUrl":"https://goo.gl/maps/EnhwARKBin25SAmA6","facebookUrl":"https://www.facebook.com/oaklandlgbtqcommunitycenter/?notify_field=blurb&modal=profile_completion&notif_t=page_profile_blurb&notif_id=1499829595947085","twitterUrl":null,"instagramUrl":"https://www.instagram.com/oaklandlgbtqcenter","youtubeUrl":"https://youtu.be/3qxj1a9esuU","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Kituo cha Jumuiya ya LGBTQ Oakland","description":"Kituo cha kwanza kabisa cha huduma kwa jamii ya LGBTQ katika Oakland kinachohusisha umri wote, chenye shirika lisilo la faida 501c3. Huduma zinazotolewa ni pamoja na makundi ya msaada, msaada wa afya ya akili, msaada wa makazi, programu ya vijana, kliniki ya kisheria, hifadhi ya chakula nk. Pia hufanya mipango maalum kwa ajili ya watu wa LGBTQ+ walio na umri na wanachama wa jamii ya transgender."},{"id":"6f38810d-896c-4493-afe2-b612021122fc","slug":"the-shed-melbourne","externalUrl":"https://www.theshedsupport.org.au/","tags":["transmasculine","mental-health","support-groups","healthcare","social-services"],"address":"412 Lygon St, Brunswick East VIC 3057, Australia","phoneNumber":null,"country":"AU","provinceOrState":"VIC","city":"Brunswick East","county":"City of Merri-bek","latLng":[-37.76497579999999,144.9730678],"email":null,"socialMedia":null,"title":"The Shed Melbourne","description":"Kikundi cha msaada kinachotegemea Melbourne kwa watu wanaofanana na wanaume, kikiwa na matukio mbalimbali na rasilimali kama mikutano ya msaada wa rika, vilabu vya mazoezi, vilabu vya vitabu, rasilimali za afya ya akili, upasuaji na taarifa na msaada wa testosterone, mipango ya binder, na zaidi."},{"id":"79fdc5af-520b-45bc-a634-7af3d030db42","slug":"shinesa","externalUrl":"https://shinesa.org.au/","tags":["healthcare","education-awareness","mental-health","social-services","support-groups"],"address":"64C Woodville Rd, Woodville SA 5011, Australia","phoneNumber":"8300 5300","country":"AU","provinceOrState":"SA","city":"Woodville","latLng":[-34.87943560000001,138.536817],"email":"info@shinesa.org.au","socialMedia":null,"county":"Charles Sturt","title":"SHINE SA","description":"Shirika la afya lililopo South Australia linatoa huduma za kitabibu, ushauri wa afya ya ngono na elimu na mafunzo yanayohusiana na afya ya uzazi na ujuzi wa mahusiano. Pia inatoa msaada na huduma jumuishi kwa jamii ya LGBTIQA+. Pia wanashiriki katika kusherehekea na kutetea haki na utambuzi wa jumuiya za kimataifa za watu wenye jinsia tofauti."},{"id":"7a817d4c-02db-4c00-9988-6c2dbf63a7d4","slug":"zoe-belle-gender-collective","externalUrl":"https://zbgc.org.au/","tags":["education-awareness","social-services","support-groups"],"address":"58 Mundy St, Bendigo VIC 3550, Australia","phoneNumber":"0467 569 635","country":"AU","provinceOrState":"VIC","city":"Bendigo","county":"Greater Bendigo","latLng":[-36.7605293,144.2860065],"email":"contact@zbgc.org.au","socialMedia":null,"title":"Zoe Belle Gender Collective","description":"Zoe Belle Gender Collective ni shirika la utetezi linaloongozwa na watu wa jinsia tofauti na wabadilikaji. Inatoa mafunzo ya kitaalam, warsha, na msaada kwa jamii ya LGBTQI+. Inatoa rasilimali na msaada kwa huduma za jamii, wafanyikazi, familia na marafiki, na watu wa jinsia tofauti na wabadilikaji. Pia hivi karibuni ilizindua Transfemme, mpango wa kuzuia dhidi ya unyanyasaji wa wanaume cis kwa wanawake walio na jinsia tofauti."},{"id":"7fb1e1a6-bd81-4515-9aaa-70aea4580e55","slug":"gender-diversity","externalUrl":"https://genderdiversity.org","tags":["education-awareness","healthcare","youth-services","support-groups","parent-family-resources","social-services","non-binary","transmasculine","transfeminine"],"address":"6523 California Ave SW #144, Seattle, WA 98136","country":"US","provinceOrState":"WA","city":"Seattle","county":"King County","latLng":[47.544046,-122.387452],"phoneNumber":"1-833-3GENDER","email":"info@genderdiversity.org","title":"Utofauti wa Jinsia","description":"Utofauti wa Jinsia unaongeza ustawi wa watoto na watu wazima wa utambulisho na uonyeshaji wa jinsia zote kwa kutoa elimu, kuongeza uelewa, na kutoa mwanga katika uzoefu mpana zaidi wa kibinadamu. Sisi pia tunasaidia katika kuunda mazingira ya kusaidia na yasiyo ya ubaguzi katika shule, timu za michezo, sehemu za kazi, na watoa huduma za afya kwa watu walio na jinsia tofauti na wale wa jinsia mbalimbali."},{"id":"83a5458b-864a-4180-a176-b291ffbc7cfb","slug":"nsw-treatment-and-rehabilitation-torture-trauma-survivors","externalUrl":"https://www.startts.org.au/","tags":["healthcare","mental-health","social-services","education-awareness"],"address":"152/168 The Horsley Dr, Carramar NSW 2163, Australia","phoneNumber":"+61 (0)2 9646 6700","country":"AU","provinceOrState":"NSW","city":"Carramar","county":"City of Fairfield","latLng":[-33.8801011,150.9654668],"email":"stts-startts@health.nsw.gov.au","socialMedia":{"googleMapsUrl":null,"linkedinUrl":null,"facebookUrl":null,"youtubeUrl":null},"title":"Huduma ya NSW kwa Matibabu na Urekebishaji wa Waathiriwa wa Mateso na Majeraha","description":"STARTTS hutoa matibabu ya kisaikolojia yanayohusiana na utamaduni, uingiliaji wa jamii, na mafunzo kwa huduma ili kusaidia watu kupona kutoka kwa makovu ya mateso na majeraha ya wakimbizi. Wanalenga kuunda mazingira salama na ya kusaidia kwa jinsia mbalimbali, jinsia, na miili ikiwa ni pamoja na wakimbizi na waomba hifadhi."},{"id":"878e809b-12aa-483f-be01-3c51a4d331d6","slug":"national-center-for-transgender-equality","externalUrl":"https://transequality.org","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","education-awareness","financial-aid-scholarships"],"address":"1032 15th St NW #199, Washington, DC 20005, USA","phoneNumber":"(202) 642-4542","country":"US","provinceOrState":"CA","city":"Washington D.C.","county":"District of Columbia","latLng":[38.903438,-77.035037],"email":"ncte@transequality.org","socialMedia":{"blogUrl":"https://transequality.org/blog"},"title":"Kituo cha Kitaifa cha Usawa wa Jinsia ya Kugeuka","description":"Kituo cha Kitaifa cha Usawa wa Jinsia ya Kugeuka ni shirika linalotetea mabadiliko ya sera na mitazamo ya jamii kwa uelewa na kukubalika zaidi kwa watu wa jinsia ya kugeuka. NCTE inatoa habari kuhusu masuala yanayoathiri jamii ya Jinsia ya Kugeuka ikiwa ni pamoja na kuzeeka, kupinga unyanyasaji, ajira, familia, afya & VVU, makazi & ukosefu wa makazi, na zaidi."},{"id":"8a206480-e41f-4bb6-9128-94d4b04cd997","slug":"the-inner-circle","externalUrl":"https://theinnercircle.org.za/","tags":["education-awareness","support-groups","spiritual"],"address":"Lester Rd, Wynberg, Cape Town, 7824, South Africa","phoneNumber":"+27 (0) 21 761 0037","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-34.011883,18.469623],"email":"admin@theinnercircle.org.za","socialMedia":{"facebook":"https://www.facebook.com/pg/The-Inner-Circle-151896104833723/","twitter":"https://twitter.com/TIC_SouthAfrica"},"town":"Wynberg","title":"The Inner Circle","description":"Jumuiya ya Ulimwenguni ya Waislamu yenye lengo la kuleta uponyaji kwa Waislamu ambao wanatengwa kulingana na mwelekeo wa kijinsia na kitambulisho cha jinsia kupitia kiroho, elimu, na ujenzi wa harakati"},{"id":"8ab7bb47-206d-4872-a3ca-e692ce2036ec","slug":"florida-name-change-home","externalUrl":"https://www.floridanamechange.org/","tags":["legal","social-services"],"address":null,"phoneNumber":null,"country":"US","provinceOrState":"FL","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Nyumbani kwa Kubadilisha Jina Florida","description":"Tovuti hii inatoa miongozo hatua kwa hatua kwa wale ambao wanataka kusasisha jina lao au jinsia nchini Florida. Hatua hizi ni pamoja na kuwasilisha ombi mahakamani, na kusasisha kadi ya Usalama wa Jamii, leseni ya udereva, pasipoti, na cheti cha kuzaliwa."},{"id":"9e09fcfd-eb5b-4dd9-825c-ae3c3c5ce940","slug":"trans-lifeline-peer-support-and-resources","externalUrl":"https://translifeline.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","support-groups","education-awareness","financial-aid-scholarships"],"address":null,"email":null,"phoneNumber":"(877) 565-8860","socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/TransLifeline/","twitterUrl":"https://twitter.com/TransLifeline","instagramUrl":"https://www.instagram.com/translifeline/?hl=en","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Trans Lifeline","description":"Trans Lifeline ni shirika linaloongozwa na trans linalotoa usaidizi wa rika na rasilimali kwa jamii ya transgender. Kwa kuzingatia msaada wa jamii, misaada midogo na hotline, wanakusudia kutoa watu wa trans na uhusiano na rasilimali wanazohitaji kuishi. Trans Lifeline pia inatetea jamii ya trans kupitia mipango kama vile #SafeHotlines."},{"id":"a453684e-c325-457f-8841-05c0adabbbc0","slug":"the-trevor-project","externalUrl":"https://www.thetrevorproject.org/","tags":["youth-services","support-groups","mental-health","education-awareness"],"address":"West Hollywood, CA 90069, USA","email":null,"phoneNumber":"(212) 695-8650","country":"US","provinceOrState":"CA","city":"West Hollywood","county":"Los Angeles County","latLng":[34.0931603,-118.3783347],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/TheTrevorProject","twitterUrl":"https://twitter.com/trevorproject","instagramUrl":"https://www.instagram.com/trevorproject/","youtubeUrl":"https://www.youtube.com/thetrevorproject","tiktokUrl":"https://www.tiktok.com/@trevorproject","twitchUrl":null,"patreonUrl":null},"title":"Mradi wa Trevor","description":"Mradi wa Trevor ni shirika lisilo la faida la Amerika linalotoa huduma za kuzuia kujiua kwa vijana wa LGBTQ+. Tovuti hii inatoa rasilimali zenye thamani kwa jamii ya watu wanaobadili jinsia, ikiwa ni pamoja na kuingilia kwa dharura na mstari wa maisha ya kuzuia kujiua, TrevorChat, na TrevorText pamoja na mwongozo juu ya afya ya akili, huduma za kijamii, na makundi ya msaada."},{"id":"a58acbca-7d7d-4c6d-8d5f-f1a281e0f8b9","slug":"pronoun-dressing-room","externalUrl":"http://www.pronouns.failedslacker.com/","tags":["non-binary","transmasculine","transfeminine","education-awareness"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Chumba cha Kuvaa Vitenzi Vimilikishi","description":"Chumba cha Kuvaa Vitenzi Vimilikishi hutoa nafasi ya mkondoni ambapo watu wana uwezo wa kujaribu na kuchunguza aina mbalimbali za vitenzi vimilikishi ili kuona kile kinachowafaa. Tovuti hii inarahisisha uamuzi katika uteuzi wa vitenzi vimilikishi kwa jamii ya watu wanaobadili jinsia, inawaruhusu kuona jinsi vitenzi vimilikishi tofauti vinavyoweza kuonekana katika muktadha tofauti."},{"id":"ab058b91-49cf-4733-b3a3-47ea59b31a78","slug":"a-place-for-marsha","externalUrl":"https://www.aplaceformarshaofficial.org/","tags":["transmasculine","non-binary","transfeminine","legal","mental-health","social-services","support-groups","education-awareness","financial-aid-scholarships","community-stories"],"email":"info@aplaceformarshaofficial.org","socialMedia":{"tiktok":"https://www.tiktok.com/@aplaceformarsha"},"title":"Mahali pa Marsha","description":"Mahali pa Marsha ni moja ya miradi mingi ya kuanzia inayolenga kusaidia watu wa Trans na familia zao katika majimbo yanayozidi kuwa hatari kuelekea mahali salama. APFM ilianza safari yake mwezi Machi wa 2023 kufuatia kuongezeka kwa sheria za kupinga-trans kote nchini. APFM sasa inazingatia kuwalinganisha Wakimbizi kutoka majimbo mekundu kama wenye vyumba, kushughulikia kwa makini kaya moja kwa wakati."},{"id":"af3483e3-d7f7-49d7-a4e9-b70e566bee98","slug":"good-hope-metropolitan-community-church","externalUrl":"https://www.goodhopemcc.org","tags":["spiritual"],"address":"18 Belmont Rd, Rondebosch, Cape Town, 7700, South Africa","phoneNumber":null,"country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-33.9605258,18.474311],"email":"secretary@goodhopemcc.org","socialMedia":{"facebook":"https://www.facebook.com/goodhopemcc"},"town":"Rondebosch","title":"GOOD HOPE Metropolitan Community Church","description":"Jumuiya ya Kikristo inayojumuisha na inayosonga mbele kisoma kimeanzishwa kwenye kanuni za Yesu Kristo ambayo inasherehekea utofauti na hutoa nafasi salama, isiyo na hukumu ambapo wote wanakaribishwa. Sehemu ya kusanyiko la Kikristo linalojumuisha lililoko Cape Town, Afrika Kusini na sehemu ya dhehebu kubwa la kimataifa lijulikanalo kama Metropolitan Community Churches (MCC)."},{"id":"b6955ff7-83b4-464f-8be8-72a50dc6a878","slug":"transvoicelessons","externalUrl":"https://www.transvoicelessons.com/","tags":["voice-training"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":"https://www.youtube.com/c/transvoicelessons","tiktokUrl":null,"twitchUrl":null,"patreonUrl":"https://www.patreon.com/transvoicelessons/posts"},"title":"TransVoiceLessons","description":"TransVoiceLessons inatoa huduma za ubora wa kudhibiti sauti na ukombozi kwa watu wa jinsia ya kupitisha na wasio na binary wanaolenga kusikika kuwa wa kiume zaidi, wa kike, au androgynous."},{"id":"b86b3697-6f65-4fd1-8506-e2ce879a614c","slug":"working-it-out-tasmania","externalUrl":"https://www.workingitout.org.au/","tags":["non-binary","transmasculine","transfeminine","mental-health","social-services","youth-services","support-groups","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"TAS","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Kufanya Kazi","description":"Kufanya Kazi ni huduma ya msaada na elimu ya jinsia, jinsia, na hali ya intersex ya Tasmania. Inatoa huduma za msaada na utetezi kwa LGBTIQ+ Tasmanians na mipango ya elimu na mafunzo kwa shule, mahali pa kazi, serikali, na mashirika yasiyo ya serikali."},{"id":"b933717d-90e3-4aff-a61f-bd1fd1f2893b","slug":"thorne-harbour-health","externalUrl":"https://thorneharbour.org/","tags":["healthcare","support-groups","mental-health","social-services","education-awareness"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Thorne Harbour Health","description":"Shirika lililodhibitiwa na jamii ya LGBTIQ+ ambalo hutoa huduma za afya na ustawi kwa jamii mbalimbali za jinsia na jinsia, pamoja na msaada wa HIV na kuzuia, ushauri, na huduma za vurugu za familia."},{"id":"be5fc820-136d-4e7f-a3b5-ae6d103ef1ad","slug":"gender-centre","externalUrl":"https://gendercentre.org.au/","tags":["transmasculine","transfeminine","non-binary","mental-health","social-services","support-groups","education-awareness","healthcare"],"address":null,"phoneNumber":"02 9519 7599","country":"AU","provinceOrState":null,"city":"Sydney","county":null,"latLng":null,"email":null,"socialMedia":null,"title":"The Gender Centre Inc.","description":"The Gender Centre Inc. inatoa huduma mbalimbali maalumu ambazo zinaruhusu uchunguzi wa utambulisho wa jinsia na msaada wa kupunguza mzozo wa jinsia. Inasaidia watu trans na waonyeshaji wa jinsia katika kila hatua ya safari yao wanapoanza kuchunguza na kuishi hisia zao halisi za nafsi. Inatoa makazi, usimamizi wa kesi, elimu na mafunzo, ushauri na huduma za afya ya akili, vikundi, habari, na rasilimali."},{"id":"c23736ad-03dc-41dd-b8f9-4f64b2727cdc","slug":"freedom-centre-wa","externalUrl":"https://www.freedom.org.au/","tags":["youth-services","mental-health","social-services","support-groups","education-awareness","parent-family-resources"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"WA","city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"https://www.facebook.com/FreedomCentrePerth","instagramUrl":"https://www.instagram.com/freedom_centre/"},"title":"Kituo cha Uhuru","description":"Kituo cha Uhuru kinatoa huduma mbalimbali za msaada kwa vijana wa LGBTIQA+ kote WA, ikiwa ni pamoja na vikao vya kujiingiza, maendeleo ya jamii, ushauri na mengi zaidi. Wao hufanya kazi kuelekea kufanya vijana wote wa LGBTIQA+ wajisikie wamejumuishwa, wameunganishwa na wanaheshimika. Pia hutoa mafunzo na mwongozo kwa wazazi, wataalamu, jamii na mashirika."},{"id":"cd48f2d0-8241-4fa5-a0aa-dc3cd3d386e8","slug":"rainbowrailroadorg","externalUrl":"https://RainbowRailroad.org","tags":["transfeminine","non-binary","transmasculine","legal","social-services"],"title":"RainbowRailroad.org","description":"Jukwaa muhimu la mtandaoni lililojitolea kusaidia na kutetea watu binafsi wa LGBTQ + ambao wanakabiliwa na mateso na vurugu ulimwenguni. Kwa kujitolea kusita kusita, tovuti inaunganisha wale walio hatarini mara moja na rasilimali za kuokoa maisha, msaada wa dharura, na njia za kuelekea salama. Kupitia ushirikiano na mashirika ya ndani na mtandao wa wafuasi wenye huruma, RainbowRailroad.org inafanya kazi bila kuchoka kutoa utetezi, msaada wa kisheria, na msaada wa kuhamisha, kuwezesha watu binafsi kutoroka mateso na kupata hifadhi. Kwa kuwa bingwa wa haki za binadamu, kuokoa maisha, na kukuza ulimwengu wa jumuishi zaidi, RainbowRailroad.org inatumikia kama mwangaza wa matumaini na ulinzi kwa watu binafsi wa LGBTQ + wanaotafuta usalama na uhuru."},{"id":"d59c0a9f-14ff-4c55-94d6-82313925be14","slug":"the-mckenzie-project","externalUrl":"https://www.themckenzieproject.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","education-awareness"],"address":"8390 W Flagler St STE 201, Miami, FL 33144, USA","email":"Info@TheMcKenzieProject.org","phoneNumber":"305-846-3186","country":"US","provinceOrState":"FL","city":"Miami","county":"Miami-Dade County","latLng":[25.769445,-80.3321284],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Mradi wa McKenzie","description":"Rasilimali jumuishi inayotoa huduma, mipango na hafla zinazolenga kuendeleza haki ya jinsia na kuhudumia jumuiya ya watu wanaobadili jinsia. Inajumuisha huduma za usaidizi na rasilimali ikiwa ni pamoja na huduma za afya, msaada wa kisheria, huduma za afya ya akili na zaidi."},{"id":"d7378cc4-7726-4de1-8427-8203cb9b61ad","slug":"east-bay-trans-queer-counseling","externalUrl":"https://www.eastbaytranscounseling.org/","tags":["transmasculine","non-binary","transfeminine","mental-health","social-services","youth-services","education-awareness"],"email":"eastbaytranscounseling@gmail.com","address":"3099 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"781-775-7802","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8538725,-122.2596505],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Ushauri wa Trans & Queer wa East Bay","description":"East Bay Trans & Queer Counseling inatoa huduma za mfumo wa alama ambazo zinajumuisha: Tiba ya kibinafsi iliyo katikati ya Berkeley, CA Support kupitia utambuzi wa jinsia na mabadiliko Barua za mapendekezo za homoni na upasuaji Mafunzo ya kitaalamu kwa wasambazaji wa afya ya akili, wanafunzi, na waajiri. Sam Davis ni Mfanyakazi wa Jamii wa Kliniki (LCSW) anayebadilisha jinsia, genderqueer na anabobea katika kufanya kazi na vijana na watu wazima wa trans, queer, genderqueer, na wanaobadilisha jinsia. Wana uzoefu wa miaka 16 kama mtoaji wa afya ya akili huko East Bay, ikiwa ni pamoja na uratibu wa kundi la msaada wa wenzao, elimu ya jamii kwenye mikutano ya LGBTQI, na miaka 9 ya mazoezi ya kliniki na ushauri wa mzozo kwa watu walio kwenye ukingo mkubwa sana kwa Kaunti ya Alameda. Wao ni mtetezi imara na aliyejitolea na historia ndefu ya kuandaa kwa niaba ya watu walio kwenye ukingo."},{"id":"dcb18ebe-596d-4d3e-a409-542f06a109a7","slug":"seahorse-victoria-club","externalUrl":"https://seahorsevic.com.au/","tags":["support-groups","community-stories","friendly-businesses"],"address":"St Kilda VIC 3182, Australia","phoneNumber":"0401 455 198","country":"AU","provinceOrState":"VIC","city":"St Kilda","county":"Port Phillip","latLng":[-37.864,144.982],"email":"seahorsevic@gmail.com","socialMedia":{"yelpUrl":null,"googleMapsUrl":null},"title":"Seahorse Victoria Club","description":"Imeanzishwa 1975, Seahorse Club Victoria hutoa rasilimali, huduma ya jamii na msaada kwa jamii ya watu wanaobadili jinsia. Inajumuisha saraka rafiki ya kutumiwa na wabadilishaji jinsia ya huduma zinazohusika na jukwaa la mtandao linalokuja kwa wanachama kuungana."},{"id":"e51c019c-8dfe-498e-b82e-4263a8f747e8","slug":"equality-florida","externalUrl":"https://www.eqfl.org/","tags":["legal","healthcare","education-awareness"],"address":null,"country":"US","provinceOrState":"FL","city":"St. Petersburg","county":null,"latLng":null,"email":null,"phoneNumber":"813-870-3735","socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/equalityfl/","twitterUrl":"https://twitter.com/EqualityFlorida","instagramUrl":"https://www.instagram.com/equalityfl/","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Equality Florida","description":"Shirika kubwa zaidi la utetezi wa LGBTQ nchini Florida linalofanya kazi kuelekea kufanya shule kuwa salama na afya, usawa wa afya ya LGBTQ, utetezi wa HIV, ulinzi wa LGBTQ na zaidi. Shirika hilo linashikilia matukio mbalimbali na limehakikisha msaada wa usawa, kuchangia kwenye misaada ya afya ya watu wanaobadili jinsia."},{"id":"e5b7c0b6-7106-4426-9809-7d59ebed9ec6","slug":"transhub","externalUrl":"https://www.transhub.org.au/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","health-providers","community-stories","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"NSW","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"TransHub","description":"TransHub ni jukwaa la kidijitali la maelezo na rasilimali kwa watu wote wa kijinsia na tofauti ya jinsia huko NSW, wapendwa wao, washirika na watoa huduma za afya. Inatoa ufikiaji wa maelezo na rasilimali zinazohitajika kwa jamii ambayo huenda isingekuwa na ufikiaji wa kama walivyokua au walivyoelekea kuelekea nafsi zao halisi. Maelezo yanatoka kwenye mahitaji ya matibabu kama vile homoni, upasuaji na orodha za madaktari hadi masuala ya kijamii na kisheria."},{"id":"e7d26256-017c-4d7e-90d2-30de9386cc03","slug":"twenty10","externalUrl":"https://twenty10.org.au/","tags":["transmasculine","non-binary","transfeminine","social-services","youth-services","support-groups","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"NSW","city":"Sydney","county":null,"latLng":null,"email":null,"socialMedia":{"instagramUrl":"https://www.instagram.com/twenty10glcs/"},"title":"Twenty10","description":"Twenty10 pamoja na GLCS inatoa huduma mbalimbali za kubadilisha maisha kwa vijana kote NSW ambao wanajitambulisha kama wasagaji, mashoga, wasio na jinsia, wanaobadili jinsia au wenye jinsia tofauti, intersex, queer, asexual au wanaouliza juu ya kitambulisho chao. Huduma zao ni pamoja na kuchukua na kuelekeza, makaazi na usimamizi wa kesi, ushauri, mipango ya msaada wa kijamii, na mafunzo ya kuwajumuisha LGBTIQA+"},{"id":"eee5057f-7302-4392-b6aa-add70e3e8556","slug":"transgendermap","externalUrl":"https://transgendermap.com","tags":["transfeminine","non-binary","transmasculine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"title":"Ramani ya Transgender","description":"Transgendermap.com ni rasilimali ya mtandaoni yenye lengo la kutoa habari za vitendo na mwongozo kwa watu ambao wanajiuliza kuhusu utambulisho wao wa jinsia au wako popote katika wigo wa transgender. Tovuti inajumuisha anuwai kubwa ya mada kama vile kuelewa istilahi ya transgender, mchakato wa mpito, maswala ya kisheria, huduma ya afya, na hadithi nyingi za kibinafsi. Lengo lake ni kuwasaidia watu kusafiri katika safari zao binafsi kwa kutoa \'ramani\' au mwongozo kwa upande mwingi wa utambulisho wa jinsia na uzoefu wa transgender. Tafadhali tembelea tovuti halisi kwa habari sahihi na za sasa zaidi."},{"id":"f0aa7c03-8837-40f8-82aa-03beb0ac46cc","slug":"transfolk-of-wa","externalUrl":"https://www.transfolkofwa.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","community-stories","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"WA","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"TransFolk wa WA","description":"Huduma ya msaada wa rika kwa watu walio na jinsia ya kubadilika na wapendwa wao katika Australia Magharibi. Inatoa vikundi mtandaoni, huduma na rasilimali zinazopendekezwa, na kuandaa matukio mbalimbali."},{"id":"fc8a7875-84dd-4df5-96ec-8aca153c8ea6","slug":"trans-families-home","externalUrl":"https://transfamilies.org","tags":["transmasculine","non-binary","transfeminine","parent-family-resources","support-groups","education-awareness"],"email":null,"phoneNumber":null,"address":null,"socialMedia":null,"title":"Familia za Trans","description":"Familia za Trans inatia matumaini, inaongeza uelewa, na inaunda njia inayoonekana ya kusaidia watoto wa jinsia tofauti na wote wanaogusa maisha yao. Tunatoa rasilimali, tunaandaa matukio, na kuunganisha familia kwa makundi ya msaada."}]')}}]);